#root {
  --tabs-height: 35px !important;
  --tabs-title-padding: 8px;
  --tabs-font-size: 13px;
  --tabs-title-lines: 1;
}

.Tab .t-box {
  align-items: center;
  max-height: calc(var(--tabs-height) - var(--tabs-title-padding));
  overflow: hidden;
}

.Tab .title {
  font-size: var(--tabs-font-size);
  white-space: pre-wrap;
  line-height: calc((var(--tabs-height) - var(--tabs-title-padding)) / var(--tabs-title-lines));
}






.Tab[data-lvl="0"] {
  --tabs-font-size: 13px; }




/* Start Tab Selected Styling */
.Tab[data-active="true"]{ 
--tabs-height: 45px !important;
  --tabs-title-padding: 8px;
  --tabs-font-size: 15px;
  --tabs-title-lines: 1;
  --tabs-border-radius: 10px;
}











